// Class to manage icons
class Icon extends HTMLElement {
  static get observedAttributes() {
    return ["name"];
  }

  get name() {
    return this.getAttribute("name");
  }

  set name(newName) {
    this.setAttribute("name", newName);
  }
  
  constructor(initName) {
    super();
    
    let style = document.createElement("style");
    style.textContent = `saco-icon {display: inline-block; height: 1em; transform: scale(1.3)} saco-icon svg {display: inline-block; height: 100%; width: 100%; min-height: 100%; min-width: 100%;} saco-icon svg *[fill] {fill: currentColor;} saco-icon svg *[stroke] { stroke: currentColor;}`
    
    this.update = () => {
      let symbol = icons[this.name];
      this.innerHTML = symbol || icons.missing;
      if (!symbol) {
        console.warn(`Failed to load icon "${this.name}".`);
        this.title = this.name;
      } else {
        this.removeAttribute("title");
      }      
      this.style.opacity = symbol ? 1 : 0.5;
      this.append(style);
    }

    if (initName) this.name = initName;
  }
  
  connectedCallback() {}

  attributeChangedCallback(name, older, newer) {
    this.update();
  }
};

customElements.define("saco-icon", Icon);